-- ----------------------------
-- Triggers structure for table dic_prov_risk_control_task
-- ----------------------------
DROP TRIGGER IF EXISTS `tg_dic_prov_risk_control_task_insert`;
delimiter ;;
CREATE TRIGGER `tg_dic_prov_risk_control_task_insert` BEFORE INSERT ON `dic_prov_risk_control_task` FOR EACH ROW BEGIN
  SET NEW.taskcode = CONCAT('RC3', LPAD(LAST_INSERT_ID(), 8, '0'));
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table table1
-- ----------------------------
DROP TRIGGER IF EXISTS `tg_table1_insert`;
delimiter ;;
CREATE TRIGGER `tg_table1_insert` BEFORE INSERT ON `table1` FOR EACH ROW BEGIN
  SET NEW.id = CONCAT('LHPL', LPAD(LAST_INSERT_ID(), 3, '0'));
END
;;
delimiter ;

